        id: "AQCfDwAAQBAJ",
        etag: "el7gHLNWCRk",
        selfLink: "https://www.googleapis.com/books/v1/volumes/AQCfDwAAQBAJ",
        volumeInfo: {
            title: "{Вы не знаете JS} Типы и грамматические конструкции",
            authors: [
                "Симпсон Кайл"
